import React from "react";
import InputLabel from "@material-ui/core/InputLabel";
import FormControl from "@material-ui/core/FormControl";
import Select from "@material-ui/core/Select";
import MensaListe from './MensaListe';
import { withStyles } from '@material-ui/core/styles'


class MensaSelect extends React.Component {


    render() {
        
        return (
            <div>
                <FormControl required className={this.props.FormControl} >
                    <InputLabel htmlFor="age-native-required">Lieblingsmensa ausw√§hlen</InputLabel>
                    <Select
                        native
                        value={this.props.value}
                        onChange={this.props.select}
                        name="age"
                        inputProps={{
                            id: "age-native-required"
                        }}
                    >
                        <option aria-label="None" value="" />
                        <MensaListe />
                    </Select>
                </FormControl>
            </div>
        );
    }
}
export default withStyles(useStyle, {withTheme: true})(MensaSelect)
